    body::after{
      content:"";
      position:fixed; inset:0;
      background: rgba(0,0,0,.1);
      z-index:-1;
    }
    .wrap{width:min(760px,100%);}
    .card{
      background:linear-gradient(180deg, rgba(255,255,255,.06), rgba(255,255,255,.03));
      border:1px solid rgba(255,255,255,.12);
      border-radius:22px;
      padding:28px;
      box-shadow:0 10px 30px rgba(0,0,0,.55);
      backdrop-filter: blur(4px);
    }
    .header{text-align:center;margin-bottom:14px}
    .logo{width:220px;height:auto;display:block;margin:0 auto 10px auto}
    h1{margin:0;font-size:30px;letter-spacing:.3px}
    h2{margin:6px 0 8px 0;font-weight:500;color:var(--muted);font-size:16px}
    .list{display:grid;gap:14px;margin-top:14px}
    .item{
      background:var(--card2);
      border:1px solid rgba(255,255,255,.12);
      border-radius:16px;
      padding:14px 16px;
      transition: all .25s ease;
    }
    .grid{
      display:grid;
      grid-template-columns: 44px 1fr;
      align-items:center;
      gap:14px;
    }
    .ico{
      width:44px;height:44px;border-radius:10px;
      display:grid;place-items:center;overflow:hidden;
      background:rgba(255,255,255,.08);
      transition: all .25s ease;
    }
    .ico img{width:28px;height:28px;display:block;transition: transform .25s ease;}
    .txt{display:flex;flex-direction:column;justify-content:center;line-height:1.2}
    .title{font-weight:700}
    .sub{color:var(--muted);font-size:14px;margin-top:4px}
    a.item{color:inherit;text-decoration:none;display:block}
    .item:hover{
      transform:translateY(-3px);
      border-color:var(--red);
      box-shadow:0 6px 16px rgba(229,51,35,.35);
    }
    .item:hover .ico{background:rgba(229,51,35,.15);}
    .item:hover .ico img{transform:scale(1.15);}
  </style>
